    "contracts/WealthCycleStaking.sol": {
      "content": "//SPDX-License-Identifier: MIT
pragma solidity 0.8.20;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import { SafeERC20 } from "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import { SafeDiv } from "./libraries/math.sol";

import { TransferHelper } from "./TransferHelper.sol";
import { IBEP20 } from "./interfaces/IBEP20.sol";
import "hardhat/console.sol";



contract WealthCyclePool is Initializable {

    using SafeDiv for uint;
    uint CycRateWhole;
    uint CycRateDecimals;
    bool private initialized;

    /**
    * @dev structs of user personal finances in system
    * @notice User finance must be accessed by mapping 
    *         USERFINANCE
    **/
    struct UserFinance{
        ///@notice Total amount of BNB a user pooled in the system
        uint totalAmountInPool;

        ///@notice Total amount of BNB a user has taken out of the system
        uint totalWithdrawn;

        ///@notice Total amount of BNB a user has withdrawn from their referals
        uint totalReferralWithdrawn;

        ///@notice Total amount of BNB withdrawn from stake earnings
        uint totalWithdrawnFromEarnings;

        ///@notice Array of stake at reapeat points
        uint [] PooledPerTime;

        ///@notice Array of timestamps per stake
        uint [] timePerPool;
    }

    /**
     * @dev structs of user data in the system
     * @notice User finance must be accessed by mapping 
     *         USERDATABASE
     * */
    struct UserDatabase{
        ///@notice Address of users Direct Upline
        address DirectUpline;

        ///@notice Array storage of downline addresses
        address [] downlineAdresses;

        ///@notice Amount of users in downline
        uint downlineTotal;

        ///@notice Flag to check when a user is signed Up False when they are not
        bool signedUp;
    }

    struct aiInfo{
        uint poolMinimum;
        bool feeOnSignup;
        uint basePoolPeriod;
        uint poolSecs;
        uint poolDays;
        address updater;
        bool referralPolicy;
    }

    struct aiFee {
        uint marketFee;
        uint taxFee;
        uint exitFee;
        address tax;
        address market;
        uint wholePercentFee;
        uint decimalFee;
    }

    struct referralData{
        bool firstGen;
        uint firstGeneration;
        bool secondGen;
        uint secondGeneration;
        bool thirdGen;
        uint thirdGeneration;
        bool fourthGen;
        uint fourthGeneration;
        bool fifthGen;
        uint fifthGeneration;
    }

    ///@notice mapping to access UserFinance struct
    mapping(address => UserFinance) public USERFINANCE;

    ///@notice mapping to access userDatabase struct
    mapping(address => UserDatabase) public USERDATABASE;

    referralData public REFERRALINFO;
    aiInfo public AI_INFO;
    aiFee internal AI_FEE;


    function initialize (uint _basePoolPeriod, address market, address tax) public initializer{
        require(!initialized, "Contract instance has already been initialized");
        initialized = true;
        //AI DATA
        AI_INFO.poolMinimum = 45000000000000000;
        AI_INFO.feeOnSignup = true;
        AI_INFO.basePoolPeriod = _basePoolPeriod;
        AI_INFO.updater = msg.sender;
        AI_INFO.poolSecs = 60;
        AI_INFO.poolDays = 86400;
        AI_INFO.referralPolicy = true;

        //Fee Data
        AI_FEE.marketFee = 4;
        AI_FEE.taxFee = 3;
        AI_FEE.exitFee = 3;
        AI_FEE.market = market;
        AI_FEE.tax = tax;
        AI_FEE.decimalFee = 1000000;
        AI_FEE.wholePercentFee = 14;

        //REF Info
        REFERRALINFO.firstGeneration = 10;
        REFERRALINFO.secondGeneration = 7;
        REFERRALINFO.thirdGeneration = 4;
        REFERRALINFO.fourthGeneration = 2;
        REFERRALINFO.fifthGeneration = 5;
        REFERRALINFO.firstGen =true;
        REFERRALINFO.secondGen =true;
        REFERRALINFO.thirdGen = true;
        REFERRALINFO.fourthGen = true;
        REFERRALINFO.fifthGen = true;

        CycRateWhole = 10;
        CycRateDecimals = 100;
    }

    function JoinPool(address referrer) public payable{
        uint amountPooled = msg.value;
        UserFinance storage USER = USERFINANCE[msg.sender];
        UserDatabase storage USERDATA = USERDATABASE[msg.sender];

        require(msg.value >= AI_INFO.poolMinimum, "YOUR POOL AMOUNT IS LESS THAN THE MINIMUM: 0.045 BNB" );

        if(AI_INFO.feeOnSignup == true) {
            uint marketFee = (AI_FEE.marketFee).mulDiv(amountPooled, 100);
            uint taxFee = (AI_FEE.taxFee).mulDiv(amountPooled, 100);

            TransferHelper.safeTransferBaseToken(  address(this), payable(AI_FEE.tax), taxFee, true);
            TransferHelper.safeTransferBaseToken(  address(this), payable(AI_FEE.market), marketFee, true);
        }

        if (AI_INFO.referralPolicy == true){
            if (referrer != address(0x000000000000000000000000000000000000dEaD)){

                UserDatabase storage REFERRERDATA = USERDATABASE[referrer];
                require(REFERRERDATA.signedUp == true, "YOUR REFERRER HAS NOT JOINED A POOL");
                require(referrer !=msg.sender, "YOU CANNOT REFER YOURSELF");                
                if (USERDATA.signedUp == true){
                    referrer = USERDATA.DirectUpline;
                }else{
                    USERDATA.DirectUpline = referrer;
                    REFERRERDATA.downlineAdresses.push(msg.sender);
                    REFERRERDATA.downlineTotal += 1;
                }
            }
        }
        USER.totalAmountInPool += amountPooled;
        USER.PooledPerTime.push(amountPooled);
        USER.timePerPool.push(block.timestamp);
        USERDATA.signedUp = true;
    }

    function WithdrawPool(uint amount) public {
        UserFinance storage USER = USERFINANCE[msg.sender];
        UserDatabase storage USERDATA = USERDATABASE[msg.sender];
        require(USERDATA.signedUp == true, "YOU HAVE NOT JOINED A POOL");
        uint totalEarned;
        uint referralEarned;

        (totalEarned, , , ) = checkUserEarnings(msg.sender);
        (referralEarned, , , ) = checkReferralEarnings(msg.sender);

        uint allEarnings = totalEarned + referralEarned;

        require(allEarnings >= amount || USER.totalAmountInPool >= amount, "YOU HAVE NOT EARNED ENOUGH TO MAKE THIS WITHDRAWAL");

        if (AI_INFO.referralPolicy == true){
            if (amount <= referralEarned){
                USER.totalReferralWithdrawn += amount;
            }else{
                uint remainder = amount - referralEarned;
                USER.totalReferralWithdrawn += referralEarned; 
                USER.totalWithdrawnFromEarnings += remainder; 
            }
        }else{
            USER.totalWithdrawnFromEarnings += amount;
        }

        if (amount > totalEarned) {
            uint lastPool = USER.timePerPool.length;
            uint daysSinceStake = (block.timestamp - USER.timePerPool[lastPool]) / AI_INFO.poolDays;
            require (daysSinceStake >= AI_INFO.basePoolPeriod, "YOU CANNOT WITHDRAW FROM YOUR MAIN POOL BALANCE UNTIL AFTER 30 DAYS");
            uint remainder = amount - totalEarned;
            USER.totalAmountInPool -= remainder; 
        }
        USER.totalWithdrawn += amount;
        uint Fees = AI_FEE.exitFee.mulDiv(amount, 100);
        amount -= Fees;
        TransferHelper.safeTransferBaseToken( address(this), payable(AI_FEE.tax), Fees , true);
        TransferHelper.safeTransferBaseToken( address(this), payable(msg.sender), amount, true);

    }

    function LeavePool(uint amount) public {
        UserFinance storage USER = USERFINANCE[msg.sender];
        uint lastPool = USER.timePerPool.length - 1;
        uint daysSinceStake = (block.timestamp - USER.timePerPool[lastPool]) / AI_INFO.poolDays;
        require (daysSinceStake >= AI_INFO.basePoolPeriod, "YOU CANNOT WITHDRAW FROM YOUR MAIN POOL BALANCE UNTIL AFTER 30 DAYS");
        require(amount <= USER.totalAmountInPool, "YOU CANNOT LEAVE THE POOL WITH MORE THAN YOUR MAIN POOL AMOUNT");

        USER.totalAmountInPool -= amount; 
        USER.totalWithdrawn += amount;
        uint Fees = AI_FEE.exitFee.mulDiv(amount, 100);
        amount -= Fees;
        TransferHelper.safeTransferBaseToken( address(this), payable(AI_FEE.tax), Fees , true);
        TransferHelper.safeTransferBaseToken( address(this), payable(msg.sender), amount, true);
    }

    function checkUserEarnings (address user) public view returns 
        (
        uint totalBNBEarned,
        uint StakeCycEquiv, 
        uint EarnCycEquiv,
        uint daysSinceStake
        ){
        UserFinance storage USER = USERFINANCE[user];
        UserDatabase storage USERDATA = USERDATABASE[user];

        require (USERDATA.signedUp == true, "THIS USER HAS NOT SIGNED UP FOR THIS SERVICE");
        uint totalEarnings;
        if (USER.PooledPerTime.length > 1) {
            for (uint i; i < USER.PooledPerTime.length; i++){
                uint daysPerStake = (block.timestamp - USER.timePerPool[i])/( AI_INFO.poolSecs);
                uint earnAmountPerStake = USER.PooledPerTime[i].decimalDiv(AI_FEE.wholePercentFee, AI_FEE.decimalFee);
                uint earningsPerStake = earnAmountPerStake * (daysPerStake);
                totalEarnings += earningsPerStake;
            }
        }else{
            uint daysPerStake = (block.timestamp - USER.timePerPool[0])/( AI_INFO.poolSecs);
            uint earnAmountPerStake = USER.PooledPerTime[0].decimalDiv(AI_FEE.wholePercentFee, AI_FEE.decimalFee);
            uint earningsPerStake = earnAmountPerStake * (daysPerStake);
            totalEarnings += earningsPerStake;
        }

        totalEarnings -= USER.totalWithdrawnFromEarnings;

        uint lastPool = USER.timePerPool.length - 1;
        daysSinceStake = (block.timestamp - USER.timePerPool[lastPool]) / AI_INFO.poolDays;

        totalBNBEarned = totalEarnings;
        StakeCycEquiv = (USER.totalAmountInPool).decimalDiv(CycRateWhole, CycRateDecimals);
        EarnCycEquiv = (totalEarnings).decimalDiv(CycRateWhole, CycRateDecimals);

        return(totalBNBEarned, StakeCycEquiv, EarnCycEquiv, daysSinceStake);
    }

