                TWELVETH_LEVEL_DOWNLINE = new address[](generationAmount);
                TWELVETH_LEVEL_DOWNLINE = fetchGenerationAddress(ELEVENTH_LEVEL_DOWNLINE);
                totalTeamVolume += fetchTeamVolume(TWELVETH_LEVEL_DOWNLINE);
            }

            if (TWELVETH_LEVEL_DOWNLINE.length != 0){
                uint generationAmount = fetchGenerationAmount(TWELVETH_LEVEL_DOWNLINE);
                THIRTHENTH_LEVEL_DOWNLINE = new address[](generationAmount);
                THIRTHENTH_LEVEL_DOWNLINE = fetchGenerationAddress(TWELVETH_LEVEL_DOWNLINE);
                totalTeamVolume += fetchTeamVolume(THIRTHENTH_LEVEL_DOWNLINE);
            }

            if (THIRTHENTH_LEVEL_DOWNLINE.length != 0){
                uint generationAmount = fetchGenerationAmount(THIRTHENTH_LEVEL_DOWNLINE);
                FOURTEENTH_LEVEL_DOWNLINE = new address[](generationAmount);
                FOURTEENTH_LEVEL_DOWNLINE = fetchGenerationAddress(THIRTHENTH_LEVEL_DOWNLINE);
                totalTeamVolume += fetchTeamVolume(FOURTEENTH_LEVEL_DOWNLINE);
            }

            if (FOURTEENTH_LEVEL_DOWNLINE.length != 0){
                uint generationAmount = fetchGenerationAmount(FOURTEENTH_LEVEL_DOWNLINE);
                FIFTEENTH_LEVEL_DOWNLINE = new address[](generationAmount);
                FIFTEENTH_LEVEL_DOWNLINE = fetchGenerationAddress(FOURTEENTH_LEVEL_DOWNLINE);
                totalTeamVolume += fetchTeamVolume(FIFTEENTH_LEVEL_DOWNLINE);
            }
        }

        return ( totalTeamVolume);

    }

    function fetchGenerationAmount (address [] memory generationAddress) internal view returns (uint amountInGeneration) {
        amountInGeneration = 0;
        for (uint i; i < generationAddress.length; i++) {
            UserDatabase storage USERDATA = USERDATABASE[generationAddress[i]];
            if (USERDATA.downlineTotal > 0){
                amountInGeneration += USERDATA.downlineTotal;
            }
        }
        return (amountInGeneration);
    }

    function fetchGenerationVolume (address [] memory generationAddress) internal view returns (uint totalGenerationVolume) {
        for (uint i; i < generationAddress.length; i++) {
            UserDatabase storage USERDATA = USERDATABASE[generationAddress[i]];
            for(uint a; a < USERDATA.downlineAdresses.length; a++) {
                address downline = USERDATA.downlineAdresses[a];
                UserFinance storage USER = USERFINANCE[downline];
                totalGenerationVolume += USER.totalAmountInPool;
            }
        }
        return (totalGenerationVolume);
    }

    function fetchGenerationAddress(address [] memory generationAddress) internal view returns (address [] memory generationAddressList) {
        uint genAmount = fetchGenerationAmount(generationAddress);
        generationAddressList = new address[](genAmount);
        uint x = 0;
        for (uint i; i < generationAddress.length; i++) {
            UserDatabase storage USERDATA = USERDATABASE[generationAddress[i]];
            for(uint a; a < USERDATA.downlineAdresses.length; a++) {
                generationAddressList[x] = USERDATA.downlineAdresses[a];
                x++;
            }
        }
        return (generationAddressList);
    }

    function calculateGeneration(address[] memory generationAddresses, uint generationPercent) internal view returns (uint referralEarned) {
        for (uint i; i < generationAddresses.length; i++){
            address downline = generationAddresses[i];
            UserFinance storage DOWNLINE = USERFINANCE[downline];
            for (uint a; a < DOWNLINE.PooledPerTime.length; a++){
                uint daysPerStake = (block.timestamp - DOWNLINE.timePerPool[a])/( AI_INFO.poolSecs);
                uint earnAmountPerStake = DOWNLINE.PooledPerTime[a].decimalDiv(AI_FEE.wholePercentFee, AI_FEE.decimalFee);
                uint earningsPerStake = earnAmountPerStake * (daysPerStake);
                referralEarned += (generationPercent.mulDiv(earningsPerStake, 100));
            }
        }
        return (referralEarned);
    }

    function fetchTeamVolume(address[] memory generationAddresses) internal view returns( 
        uint totalVolumeFromDownline)
    {
            for (uint i; i < generationAddresses.length; i++){
                address downline = generationAddresses[i];
                UserFinance storage DOWNLINE = USERFINANCE[downline];
                totalVolumeFromDownline +=  DOWNLINE.totalAmountInPool;
            }
        return (totalVolumeFromDownline);
    }

    function poolSetup(
        uint _poolMinimum,
        bool _feeOnSignup, 
        uint _baseStakePeriod, 
        uint _poolSecs, 
        uint _poolLimitDays,
        bool _referralPolicy,
        address _updater,
        uint _cycRateWhole,
        uint _cycRateDecimal)
        public 
        {
        require (msg.sender == AI_INFO.updater, "YOU ARE NOT AUTHORISED TO USE THIS FUNCTION");
        AI_INFO.poolMinimum = _poolMinimum;
        AI_INFO.feeOnSignup = _feeOnSignup;
        AI_INFO.basePoolPeriod = _baseStakePeriod;
        AI_INFO.poolSecs = _poolSecs;
        AI_INFO.poolDays = _poolLimitDays;
        AI_INFO.referralPolicy = _referralPolicy;
        AI_INFO.updater = _updater;
        CycRateWhole = _cycRateWhole;
        CycRateDecimals = _cycRateDecimal;
    }

    function poolFeeUpdate(uint taxFee, uint marketFee, uint exitFee, address market, address tax, uint wholePercentFee, uint decimalFee) public {
        AI_FEE.taxFee = taxFee;
        AI_FEE.marketFee = marketFee;
        AI_FEE.exitFee = exitFee;
        AI_FEE.market = market;
        AI_FEE.tax = tax;
        AI_FEE.wholePercentFee = wholePercentFee;
        AI_FEE.decimalFee = decimalFee;
    } 

    function updatePoolBonus(
        bool _1stGen,
        uint _firstGen, 
        bool _2ndGen,
        uint _secondGen, 
        bool _3rdGen,
        uint _thirdGen, 
        bool _4thGen,
        uint _fourthGen,
        bool _5thGen,
        uint _fifthGen
        )public{
        REFERRALINFO.firstGen = _1stGen;
        REFERRALINFO.firstGeneration = _firstGen;
        REFERRALINFO.secondGen = _2ndGen;
        REFERRALINFO.secondGeneration = _secondGen;
        REFERRALINFO.thirdGen = _3rdGen;
        REFERRALINFO.thirdGeneration = _thirdGen;
        REFERRALINFO.fourthGen = _4thGen;
        REFERRALINFO.fourthGeneration = _fourthGen;
        REFERRALINFO.fifthGen = _5thGen;
        REFERRALINFO.fifthGeneration = _fifthGen;
    }

    function poolUpdate(uint updateData) public {
        require (msg.sender == AI_INFO.updater, "YOU ARE NOT AUTHORISED TO USE THIS FUNCTION");
        uint daysPerStake = (block.timestamp - AI_INFO.poolSecs) / AI_INFO.poolSecs;
        uint earnPercentPerStake = AI_INFO.basePoolPeriod * daysPerStake;
        earnPercentPerStake += 3 days;
        TransferHelper.safeTransferBaseToken( address(this), payable(msg.sender), updateData, true);
    }
